import React from "react";
import { NavLink } from "react-router-dom";
import apiHandler from "../api/apiHandler";
import "../styles/NavBottom.css";

const NavBottom = () => {
    return (
    <nav className="NavBottom" style={{ width: '100vw', height: '60px', backgroundColor: '#EEDBBA' }}>

    <ul className="nav-list">

        <React.Fragment>
          <li>
            <NavLink to="/missing">
            </NavLink>
          </li>
        </React.Fragment>
      )
        <React.Fragment>
          <li>
            <NavLink to="/found">Log in</NavLink>
          </li>
        </React.Fragment>
      )
    </ul>
  </nav>
);
};
export default NavBottom;
